import React from 'react'
import Nav from './Nav/Nav';
import './Auth.css'

const Auth = () => {
  return (
        <div className='DetailContainer'>
        <Nav />
            <label>Username</label>
            <input type='text' />
            <label>Password</label>
            <input type='text' />
        </div>
  )
}

export default Auth
